import React, { Component } from  'react';

class PeopleList extends Component {

    renderPeople = () => {
		if(this.props.people !== undefined) {
			return this.props.people.map(person => {
				return (
					<div key={person.id}>

						<img src={`Albums/${person.name}/${person.profile_pic}.jpeg`} alt="" />
						<div>
							<h1>{person.name}</h1>
							{
								person.online_status === "on" && <img src="Albums/live.svg" alt="live" />
							}
						</div>
					</div>
				)
			})
		}
	}


	render() {
		console.log('peoplelist.js', this.props.people)
		return(
			<div className="allProfilePicContainer">
				{this.renderPeople()}
			</div>
		);
	}
}

export default PeopleList;
